    case Qt::UserRole + 3:
      return QVariant::fromValue(matched(index.row()));
    case Qt::UserRole + 4:
      return QVariant::fromValue(muted(index.row()));
    case Qt::UserRole + 5:
      return QVariant::fromValue(pairwise(index.row()));
    case Qt::UserRole + 6:
      return cleanNullQVariant(QVariant::fromValue(picture(index.row())));
